class PPoPCodeDerivation:
    """Handles PPoPCode derivation logic."""
    def derive_ppop_code(self, code: str) -> str:
        """Derive PPoPCode handling special cases like 00***** and 00FORGN."""
        if code.startswith("00") and code.endswith("*****"):
            return "SPECIAL_CASE_00STAR"
        elif code == "00FORGN":
            return "SPECIAL_CASE_FORGN"
        return code.upper()

